import React from "react";
import { Route, Switch } from "react-router-dom";
import LoginPage from "./pages/LoginPage";
import MainPage from "./pages/MainPage";

const App = () => {
  return (
    <Switch>
      <Route path="auth">
        <LoginPage />
      </Route>
      <Route path="/" exact>
        <MainPage />
      </Route>
    </Switch>
  );
};

export default App;
